	feeling3 = "指揮官，你今天打算加班嗎？這樣的話，我稍後準備一壺咖啡帶去辦公室吧。欸？沒關係，不麻煩的。即使沒有要交給我的工作，只是在你身邊陪著你也好呀~",
	lose = "哎呀呀，失敗了呢…",
	propose = "希望我永遠留在身邊？可以哦，照顧指揮官本來就是我的職責呢。 ……欸，難道說，這是告白嗎？ ……嗯，我的回答，依然是——yes哦。從今往後，也請多多指教了，指揮官~",
