	win_mvp = "指揮官一定也會很高興吧~",
	home = "指揮官，接下來禁止工作了哦？你需要先好好休息一下才行呢。",
	mission = "指揮官，任務不做的話只會越來越多哦？",
	touch2 = "做這種事還是要注意一下場合哦？",
	voice_key_2 = -1,
	skill = "能命中就好了呢~",
