	touch = "碳酸飲料？唔，真是沒辦法呢，今天只能喝一瓶哦？",
	profile = "我是皇家黛朵級的赫敏哦~艦歷的話…參加過對俾斯麥的追擊，還對付過薩丁的潛艇…除此之外，好像也沒有什麼太值得一提的了呢，還想知道什麼嗎，指揮官？",
	mission_complete = "哇，任務獎勵還不少呢，指揮官真厲害~",
	feeling4 = "指揮官，要是不介意的話，把你的換洗衣服也交給我來洗吧，一起洗比較方便，而且，也想讓你感受一下手洗的衣服呢~",
	unlock = "你好呀，我是黛朵級的赫敏，是皇家女僕隊的一員，希望我們能夠好好相處呢，指揮官。",
	feeling5 = "呼…房間這樣就算打掃完畢了，接下來…啊，你回來了呀，那我就先開始做飯吧，請先做點別的什麼事等一下吧~",
	main = "用眼過度可不是什麼好事哦？來，先洗把臉提起精神吧。 |嗯…最近這些食材的價格好像上漲了一些呢…指揮官，接下來包含這些食材的菜會減少一些哦？ |看著指揮官順利解決一個個工作的樣子，不知為何連我都變得開心起來了呢…真是不可思議。",
	battle = "發現敵人囉~",
	upgrade = "咦，我變強了嗎？",
	voice_key = 20227,
	headtouch = "",
	feeling2 = "黛朵…很害怕失去主人呢，她那麼努力，又那麼能幹，指揮官怎麼可能討厭她呢…不過我說了多少次都沒用…還是要麻煩指揮官多照顧她一些了呢。",
	login = "早上好呀，指揮官。有好好休息過了嗎？",
	vote = "",
	hp_warning = "有些大意了呢…",
	id = 202270,
	detail = "女僕長…貝爾法斯特小姐能力很強，又有著堅定的意志…我很憧憬呢，要是有一天，能成為那樣的存在就好了…",
	couple_encourage = {
