	feeling3 = "指揮官，就算是近衛騎士，也沒道理整天待在港區。差不多讓我出擊——唉…不行，壓力又堆積起來了…",
	lose = "可惡…下次絕對要你們好看…！啊，咳咳，沒什麼，趕快帶大家回去吧？",
	propose = "以戒指之契起誓，前衛之劍，以及生命都將永遠獻給指揮官！…好啦~這下可以稍微放鬆下了吧？我想也沒必要總在指揮官面前刻意保持形象了～",
	expedition = "確認委託組返回。指揮官，請做好迎接的準備吧。",
	win_mvp = "很好！是我贏了！…（將我等的勝利作為指揮官的勝利而盛讚吧！）……糟，糟了，把心裡想的說出來了！？",
	home = "指揮官回來了！各位，回顧下戰鬥，同時進行修理補給——指揮官，這些就交給我，請稍作休息。",
	mission = "新任務下達了。指揮官，做好應對吧。",
	touch2 = "好了好了，現在停止這樣的行為……哈。不然揍你哦？",
	voice_key_2 = -1,
	skill = "見識下騎士的劍術吧！",
	drop_descrip = "戰列艦—前衛",
	mail = "新郵件在此。指揮官，請確認。",
	touch = "作為近衛騎士，我會對指揮官的安全負責，好好完成輔佐工作的。",
	profile = "我是皇家騎士前衛，大戰中最後完成的戰列艦。我會成為你的劍，為港區帶來榮耀與武勳…不過我有個不情之請，可以的話，請不要嫌棄我的裝備老舊就好。",
	mission_complete = "任務完成。唉，應該早點注意到的…",
	feeling4 = "什麼？又是文書工作？做當然會做，不過這種事差不多也該結束了吧…我也不是說硬要出擊，不過指揮官能不能安排下——可以嗎？太好了！",
	unlock = "皇家騎士隊，近衛騎士前衛，正式前來報到！我發誓，此後將吾劍交付於你，為你盡吾等忠義！願女王陛下，以及率領艦船的指揮官榮光無盡！",
	feeling5 = "嗯！感覺清爽多了！不愧是指揮官，偶爾還是會做些好事的嘛！這才有作為近衛騎士侍從的價值。那麼，掌管吾劍之人啊，請對前衛下達下一個命令吧！",
	main = "交給我吧，喬治五世殿下，只要女王陛下和指揮官一聲令下，我將欣然化為斬入敵陣的劍芒。|那是……{namecode:435}？唔，有點尷尬……|港區警備沒有異常，指揮官的近身護衛也無懈可擊！請放心！|說實話，皇家料理也不算特別美味……吧？當然各人喜好不同，皇家出身的我說這話也不大合適就是了……|指揮官，今天的日程在這裡！…啊呀，跟想看的節目時間撞上了…不，沒，沒什麼！",
	battle = "來吧，跟我堂堂正正地決一勝負！",
	upgrade = "此劍為皇家和指揮官的榮光而存！",
	voice_key = 20513,
	headtouch = "有什麼事…嗎？",
	feeling2 = "那麼指揮官，今天的工作是——為了處理文書工作要加班？了解，不過不至於連今天的演習都參加不了吧？",
	login = "指揮官來了！各位，打起精神來！…好啦，招呼打完就可以繼續幹活了",
	vote = "",
	hp_warning = "真棘手…！",
	id = 205130,
	detail = "吾之劍為忠義之刃，吾之炮火為榮耀之光！閃耀吧！皇家之劍！……嗚，太羞恥了！不過很帥氣呢…指，指揮官？！",
	couple_encourage = {
		{
			{
				30514
			},
			1,
			"好像能聽見什麼…",
			0
		},
		{
			{
				20403
			},
			1,
			"胡德女士，請小心！",
			0
		}
	}
}

