_G.pg.base.ship_skin_words[502040] = {
	feeling1 = "……應瑞對指揮官沒有什麼想說的。",
	feeling3 = "肇和是不是跟您告狀，說我逼她幹活了？可不能輕信了她的話哦，我只是讓一直以各種理由逃避家務的姐姐稍微面對一下現實而已，呵呵。",
