	touch2 = "現在是大聲喊“非禮”的最佳時機呢，如果指揮官給我一點好處的話，我可以考慮放你一馬哦？",
	voice_key_2 = 502042,
	skill = "丹青不渝！",
	drop_descrip = "肇和級防護巡洋艦—應瑞",
