	touch = "感覺疲倦的話，要趁早休息哦。若是因為過勞而拖垮了身體，可就得不償失了。",
	profile = "我是肇和級防護巡洋艦二號艦——應瑞，同時也是肇和的妹妹。順便一提，如果您恰好看到我和姐姐拌嘴，請不要驚訝，那正是我們關係融洽的表現，嗯~",
