	feeling5 = "雖然有許多話語想要傾訴，看到指揮官後，反而不知該付諸何種話語…還是以筆墨寄託應瑞此時的情感吧。請指揮官不要見笑…",
	main = "肇和把撐場面的事都交給了我呢。我倒是不介意，只是這樣長久下去，她離想要穩固“姐姐”地位的願望不就反而越來越遠了嗎…|指揮官，這是來自應瑞的溫馨提醒——您已經發呆好一會了哦？|指揮官對書畫感興趣嗎？如果你有時間的話，我可以教你。雖然聽起來有點像自誇，不過這方面我還是比較擅長的呢。",
	battle = "除惡務盡！",
	upgrade = "想要保護重視之物，就得讓自己變得足夠強大才行呢。",
	voice_key = 50204,
	headtouch = "要是弄亂頭髮，可就要罰指揮官幫我梳一個星期的頭髮哦？",
	feeling2 = "肇和現在應該在練舞吧。指揮官，不如…我們一起悄悄去看看？",
	login = "勤勞的指揮官，今天也按時來工作了呢。指揮官…真的沒想過偷偷懶嗎？",
	vote = "",
	hp_warning = "我們不會，也不可能在這裡退縮…！",
	id = 502040,
	detail = "嚴格說來，從時間上來算的話，我好像的確是姐姐呢…不過，既然肇和這麼看重“姐姐”，這個身份就讓給她吧。而且，身為“妹妹”，也是會有許多意想不到的便利的呢，呵呵~",
