_G.pg.base.ship_skin_words[702070] = {
	feeling1 = "指揮官同志，我覺得，我們還是有些合不來……抱歉。",
	feeling3 = "我平時會看一些兵法書，它們能在我制定計劃時提供一些靈感。指揮官同志感興趣的話，我可以借你幾本？比如這本《用距離感吸引你在意的——》……啊不好意思拿錯了。",
