	feeling5 = "指揮官同志？怎麼了？我最近很好，就和平常一樣，什麼事都沒有哦？不需要太關心我的。 （小聲）沒關係的，無論多久我都可以等你的，這次的“對指揮官攻略作戰”絕對不會失敗……",
	main = "如烈火一般熾熱，如堅冰一般冷冽。有人曾這麼評價過基洛夫和我……大概就是這樣吧。|指揮官同志，現在的時間是？謝謝……呼，看來我還沒有錯過什麼東西。|消磨時間的方法嗎？我的話會把冰塊放進屋子裡，然後看它慢慢化掉……指揮官同志呢？",
