_G.pg.base.ship_skin_words[705010] = {
	feeling1 = "將莽撞當作勇氣的人是沒有未來的，同志啊",
	feeling3 = "同志啊，希望你不要誤會，這不僅僅是我們的戰鬥，更是你的戰鬥。不要僅滿足於現狀，我們要一起不斷精進才行",
