	mail = "信來了。同志啊，盡快拆了看看吧",
	touch = "艦裝？只要能使我們變強的，都應該利用起來，再美妙不過的合理主義了不是嗎。我是不會甘心忍受自己弱小的",
	profile = "我是北方聯合的弩級戰列艦，甘古特！哼，別以為我是舊型就小看我。無論人還是艦船，都只有在力量不足的時候才會渴望強大，在窘境之時才更加追求революция。從波羅的海，到列寧格勒，只有忍辱負重，拼盡全力戰鬥至最後一刻，方能閃現出最耀眼的光輝！",
