	unlock = "呼哈哈哈！幹得不錯，同志！讓我們團結起來，為了守護這條碧藍的航線而奮鬥吧！竭盡全力，至死方休！",
	feeling5 = "單刀直入地說吧！同志的光芒令我感到心神一振——沒錯，我喜歡上你了！現在我擺在眼前的，是名為“向同志表達愛意”的挑戰！來吧，收下我這愛的擁抱！",
	main = "同志啊，陪我喝幾杯吧？…什麼？你不會一杯伏特加下肚就不行了吧？ |同志啊！聽完那些水兵們的故事，是不是很心潮澎湃！那正是革命者的，人性的光輝啊！ |輕鬆獲勝？說什麼傻話呢，同志。不是苦戰的話根本無法使出全力！下次派我到更危險的戰場去吧！",
	battle = "讓我看看你們的勇氣吧！ ！",
	upgrade = "同志啊，你也要變得更強！然後與我一同在戰場發揮光熱才行！啊哈哈哈哈！",
