	hp_warning = "呼哈哈哈哈哈！這才像是我該在的戰場啊！",
	id = 705010,
	detail = "就算失敗、跌倒，滿身泥濘，也能一次一次重新振作起來的人性光輝——這才是我所追求的революция(革命)，才是我所鍾愛的небо(天國)！",
