_G.pg.base.ship_skin_words[801070] = {
	feeling1 = "要懺悔的話，請移步到樞機卿大人那裡。",
	feeling3 = "只是閒聊嗎？那，生命，愛情，和自由，對您而言哪個是最重要的呢？呵呵呵，不用著急回答。我就是想看看指揮官大人糾結煩惱的樣子才這麼問的。",
