	touch = "無論是祈禱還是懺悔，都可以找我哦，指揮官大人。",
	profile = "我曾隸屬於布雷斯特第十分隊，護送過不少艦船，也曾在皇家的砲火下帶著斯特拉斯堡倉皇逃離。承蒙上天眷顧，在我選擇了自由鳶尾後，最終看到了勝利的曙光。",
