	feeling5 = "指揮官大人，如果有一天可怖要奔赴死地，您會阻止嗎？ ……嗯~這個問題好像簡單過頭了。啊，並不是故意讓您煩惱的，只是想更多了解您而已。呵呵~",
	main = "和惡毒姐的那次小事故？我已經和她道過歉了，但她好像沒放在心上呢……|嗯？指揮官大人呆呆的，莫非是在……啊，我是說，偷懶是不好的，這點您應該向凱旋學習。 |牽掛的鎖鏈太多，就會束縛理想的翅膀。指揮官大人，您有過想要飛得更高更遠的野心嗎？",
	battle = "你們又是為何而戰呢？",
	upgrade = "誰都不敢斷言自己已經達到了最強。指揮官大人，您覺得呢？",
