	headtouch = "唔，請不要碰我的帽子。",
	feeling2 = "既不是祈禱也不是懺悔嗎？這樣啊，那我也做點其它事情打發下時間好了…嗯嗯。",
	login = "歡迎回來，指揮官大人。有何事吩咐可怖？",
	vote = "",
	hp_warning = "鳶尾會保佑我們的！",
	id = 801070,
	detail = "我算是“人不犯我我不犯人”主義吧，不過港區裡不少同伴和我提出了速度比賽……雖然最後她們都輸了。這讓我在這裡認識了不少夥伴呢——也挺好的不是嗎。",
