	touch = "為了鳶尾，為了正義與和平，我願意聽從您的命令。",
	profile = "拉·加利索尼埃級巡洋艦馬賽曲，鳶尾教國的戰鬥天使。我不知疲倦，不懼痛苦，為和平與正義而揮劍。縱使世間依舊存有不公……但終有一天，它們將被戰勝。",
