	propose = "謝謝您。從此刻開始，我的力量、我的身心、還有我的一切，就全部為您所有了。呵呵呵，從今天開始，讓我們一點一點、一點一點地品嚐生活中的甜蜜吧——我的夥伴，我的摯愛",
