	lose = "啊哈哈，輸了啊……說起來，其實我是個有點記仇的人呢。",
	propose = "我可是一位不折不扣的壞女人。像是精心排好約會的日程，刻意製造出只有兩個人在的時間，裝作無心卻在意著你今天見了誰……這樣那樣的事情，我都有可能做得出來哦？……所以，做好心理準備了嗎？",
	expedition = "把這些慰問品送去給歸港的委託隊吧。嗯？你好奇是什麼時候準備的？這不重要，不是嗎？呵呵～",
	win_mvp = "勝利的砝碼又多了一枚，局勢已然向我們傾斜。",
