	touch = "指揮官，你現在正一副「我有話想說」的表情哦？",
	profile = "黎胥留級未完成的第三艘，克里蒙梭。相較於大名鼎鼎的黎胥留與讓巴爾，我曾在襁褓中被無奈遺棄。我沒有名聲，亦無過往，這也是我最大的優點——這樣，就不會有人在意站在幕後的我了。",
	mission_complete = "任務已經完成了。有條不紊地解決計劃中的事項，這便是工作狀態的你嗎。",
	feeling4 = "不介意把你的興趣愛好告訴我吧？這樣，我才能「投其所好」，不是嗎？你要是覺得沒辦法坦白說出口的話，那我就只好跟同伴打聽了。",
	unlock = "維希教廷戰列艦克里蒙梭，很高興能與指揮官你共事。相對事蹟早已無人不曉的你而言，我算是陌生的一方吧。在正式合作之前，你有什麼想問我的嗎？",
