	main = "指揮官既是舞台上的領導者，也是幕後的參謀家。你比較喜歡哪一個身分？又或者，其實你只想做一個觀眾？|在皇家享受茶會，再到北方聯合飲下熱情的伏特加——即使是刻板印象，對拉近距離而言卻極其有效。不過伏特加確實有點……|單純是單純者的藍天，精明者亦有精明者的城府。我從不輕易地對他人下定論，畢竟朋友也有很多相處的方式，不是嗎？",
	battle = "一齣好戲，即將開場——",
