_G.pg.base.ship_skin_words[907010] = {
	feeling1 = "請不要逼我對您展開“另一邊”的工作。大家會傷心的。",
	feeling3 = "不僅是“戰鬥”，還希望我和其他夥伴好好相處嗎？明白了。既然統率港區的您這麼說，我照辦就是。",
