	unlock = "我是鳶尾的航母，霞飛。您就是這個港區的指揮官對吧。呼呼呼…願您也能得到鳶尾的庇佑。",
	feeling5 = "我不喜歡拐彎抹角，下次休假的時候一起去約會如何？如果不答應我的邀請——呼呼，你就要好好想下怎麼讓我開心了哦，指揮官。",
	main = "作為制裁罪惡之人，某種意義上我憎恨著所有人。因為人生而有罪。|手停下來了哦？您尚有應盡的職責未完成吧？|我並不會裁決您行動的善惡，因為是我的職責是裁決您的存在本身。",
