	unlock = "战场瞬息万变，唯有保持冷静，谨慎应对才能立于不败之地，指挥官做到了吗？二水战旗舰{namecode:39}，向您问好",
	feeling5 = "不管其他人如何评价，贯彻自己的道路才是一个领袖应该有的心气，而道路是否正确，看部下是不是心甘情愿就知道了，比如说，您可以看看我……",
