_G.pg.base.ship_skin_words[9600010] = {
	feeling1 = "哎呀呀，這放在以前，你是要被船員們扔下海餵鯊魚，或者被扔在某個荒無人跡的小島哦？",
	feeling3 = "時至今日，依舊有許多人對過去海盜的寶藏十分痴迷呢。畢竟沒有人能拒絕一大箱閃著光的黃金珠寶…嗯？你問我寶藏在哪裡？哎呀，作弊可不行哦，探索工作得親自來做才行~",
	lose = "啊啊啊！討人厭的燕子，快走開快走開！",
	propose = "唔……你真的想好了？和我在一起可是一件很辛苦的事情哦？不可以反悔哦？……那好，牽起我的手，為我戴上戒指吧！登上我的船，然後揚帆起航吧~",
	expedition = "委託的隊伍滿載而歸了！指揮官，她們正等著你分戰利品呢，快去快去~",
	win_mvp = "嘻嘻~討人厭的傢伙們全部去餵鯊魚囉~",
	home = "你回來啦？有沒有什麼有趣的冒險經歷能分享分享？比如說——在暴風雨和巨浪中被鯊魚追逐最終逃出生天之類的？",
	mission = "有新的任務嗎？讓我看看……這個任務雖然有點危險，不過能賺的錢最多，就選它吧！",
	touch2 = "被毒死被刺死被淹死被絞死選一個吧？",
	voice_key_2 = -1,
	skill = "把對面～全都幹掉~！",
	drop_descrip = "充滿謎團，可愛又迷人的皇家幸運，現在來到你的眼前！…哎呀？嚇了一跳？不用在意不用在意～所以接下來我們要去哪？傳說中埋藏著寶藏的海岸？還是堆滿了殘骸的暗礁？不管哪裡都好，總之先把帆揚起來出發吧~",
	mail = "有信？會不會是通緝令之類的？……要是指揮官被通緝的話，賞金該有多少呢~",
	touch = "終於受夠無趣的辦公，想出去透透氣了嗎？要出發的話我隨時奉陪哦~",
	profile = "你說我的過去嗎？就和那些故事書裡的海盜一樣——在海上當惡霸，欺負被我盯上的傢伙，過著每天都不一樣的生活~可惜運氣不好，碰上了狠角色，快樂的日子就只能被迫結束囉。",
	mission_complete = "任務完成了哦！話說，我作為你的秘書艦，能拿多少報酬呀？",
	feeling4 = "嗯……指揮官，你願意和我一同出海的原因，其實並不是為了那些財寶吧？也不像是單純找尋刺激……該不會是為了我吧？哎呀，真的假的，真是討厭~……話說，你不反駁嗎？",
	unlock = "充滿謎團，可愛又迷人的皇家幸運，現在來到你的眼前！…哎呀？嚇了一跳？不用在意不用在意～所以接下來我們要去哪裡？傳說中埋藏著寶藏的海岸？還是堆滿了殘骸的暗礁？不管哪裡都好，總之先把帆揚起來出發吧~",
	feeling5 = "如果你沒想好今天要去的地方的話，我就替你做主了哦？要不然就——最近盛傳埋有寶藏的不知名小島？哎呀，沒什麼好怕的，大不了就兩個人流落荒島嘛，出發出發！",
	main = "電影！遊戲！現代娛樂真是太棒了！這樣沒出海時也能做些開心的事了呢~|所謂賭博嘛，就是看運氣的再分配而已。賭桌上沒有贏家與輸家，只有一群分別被幸運與不幸沖昏了頭腦的可憐人罷了。|海盜也有海盜的規則哦~沒有規矩可凝聚不了人心。指揮官，你這裡的規矩又是什麼呢？",
	battle = "衝呀衝呀，寶藏先到先得哦~",
	upgrade = "既然變強了，為什麼不來一場刺激的冒險呢？",
	voice_key = 960001,
	headtouch = "隨隨便便碰人家的帽子可不好哦？",
	feeling2 = "所謂及時行樂，就是要做自己開心的事，把煩惱顧忌什麼的通通拋在腦後！……所以，不能再像以前那樣搶別人東西了嗎？真是遺憾啊……",
	login = "哎呀，指揮官你終於回來了~快點把今天的工作做完，這樣我們就有時間去冒險了！",
	vote = "",
	hp_warning = "那就看看幸運女神站在哪邊吧！",
	id = 9600010,
	detail = "乖孩子們該去休息囉，姐姐下次再給你們講海盜故事~嗯？指揮官，你也感興趣嗎？不過給指揮官講的話，“大人的海盜故事”會更好一點？呵呵~",
	couple_encourage = {}
}

