_G.pg.base.ship_skin_words[9701010] = {
	feeling1 = "不行……你作為指揮官，無法讓我信服……",
	feeling3 = "嗯？指揮官？你是特地來接我的嗎？我習慣了一個人返航，沒有必要就是……不過，還是謝謝你了。",
	lose = "獵人，總歸也會有成為獵物的時候嗎……",
	propose = "嗯，我明白你的心情了。如果你不嫌棄這樣的我的話，就請允許我站在你的身邊吧。在最終的威脅來臨之前……或者是之後，我都會陪你一同走下去的。",
	expedition = "委託的同伴們回來了。你有一群值得信賴的部下啊。",
	win_mvp = "真正的威脅還在後面，不要掉以輕心。",
	home = "回來了嗎？平安無事就好。出擊辛苦了，恢復一下體力吧。",
	mission = "新的任務？那麼，這次又要給誰帶來解脫呢。",
	touch2 = "做這種事，有什麼意義呢……",
	voice_key_2 = -1,
	skill = "安息吧。",
	drop_descrip = "獵人號驅逐艦<color=#92fc63>(若已獲得相應的META角色，獎勵將會轉化為對應的角色結晶，可在「META研究室」-「能量啟動」中使用)</color>",
	mail = "新的信件來了。指揮官，不要錯過關鍵的情報。",
	touch = "你累了嗎？休息一下吧，我來放哨。",
	profile = "我是獵人，同時目前也算是你的部下，有什麼事情都可以吩咐我。至於的我一直在“狩獵”的對象……以後你會知道的。",
	mission_complete = "又可以劃掉一個任務了。但是，狩獵不會因此而結束……",
	feeling4 = "每當回到這裡時，身體上的疲勞恢復了，心靈上的疲憊似乎也消散了……也許我把這個據點，逐漸當成了重要之處吧……",
	unlock = "指揮官，你好，我是獵人。正如你所見，我是一名“獵人”，正在尋找我的“獵物”。這裡就是我的新據點嗎？",
	feeling5 = "呼……第一次在你的港區裡睡了個懶覺。是我的危機感變弱了嗎，還是我的身手變得遲鈍了……不，好像不是這樣。單純地，是體會到了“放心”的感覺吧。",
	main = "面對突如其來的危險，不是所有人都能保持鎮定……指揮官，身為領導者，你一定不能失去你的理智。|嗯……你要找的文件是這份嗎？花了一點時間，把你常用的東西位置都記下來了。姑且算是獵人的基本功吧。|這是……茶和點心嗎 ？呼……不怎麼習慣這種精緻的食物。像這樣待在指揮室沒什麼事做，也不習慣……",
	battle = "我先上了，總是要有人先一步闖入危險之中的。",
	upgrade = "裝備更加精良了……也好。",
	voice_key = 970101,
	headtouch = "",
	feeling2 = "所以這裡要成為我的長期據點了嗎……也好吧。有一個落腳點和補給站，總歸是件好事。",
	login = "是你啊。又要開始那些反復的文字工作了嗎？辛苦了。",
	vote = "",
	hp_warning = "呃……我必須保持鎮定！",
	id = 9701010,
	detail = "如果有一天，我變成了怪物……我希望你能忘掉交情，不顧一切地終結我……",
	couple_encourage = {}
}

_G.pg.base.ship_skin_words[9701020] = {
	feeling1 = "請不要靠近我！對，對不起……我怕自己會失控……",
	feeling3 = "若命運女神真的存在，我有很多，很多的問題想問她……但事到如今，這些問題能否得到解答，已經都不重要了……",
	lose = "不……不應該是這樣的……這樣不對，這樣不對！",
	propose = "以這副樣子接受您的饋贈，實在是抱歉……感謝您能接受這樣的我。也許遇見您，就是我的命運軌跡裡，最幸福的一件事吧。",
	expedition = "委託好像完成了……對不起，我這個樣子，幫不上什麼忙……",
	win_mvp = "是命運眷顧了我嗎，還是……",
	home = "順利完成作戰了。看來，指揮官命運的軌跡在向著好的地方延伸著……",
	mission = "那個，指揮官，我擔心您忘了……還有沒完成的任務……",
	touch2 = "嗚嗚……這，這是命運對我的考驗嗎……",
	voice_key_2 = -1,
	skill = "請寬恕我……",
	drop_descrip = "命運女神號驅逐艦<color=#92fc63>(若已獲得相應的META角色，獎勵將會轉化為對應的角色結晶，可在「META研究室」-「能量啟動」中使用)</color>",
	mail = "指揮官，有您的郵件……啊，這副樣子不方便幫您遞過來……",
	touch = "沒事的，在意的話，就請摸吧……我會控制住自己的……",
	profile = "雖然冠以命運女神之名，但似乎我才是被命運牽動的那一方……啊，您還是很在意這個形象嗎？這個，算是我為了不傷害到身邊的人，自己給自己施加的“保險”吧……",
	mission_complete = "任務完成了……一切都會好起來的吧。",
	feeling4 = "與您在一起時，我能感到自己的命運正向著一個全新的，未知的方向前進……雖然很模糊，但卻不斷地給我溫暖的感覺……",
	unlock = "您好，指揮官。我是命運女神。……請不用在意我身上的這些，只是一些…對力量必要的限制而已。",
	feeling5 = "指揮官，我把我的命運交給您了……是您的話，即使我偏離了正軌，您也一定能讓我重新回到正確的道路上的。我……想留在您的身邊，可以嗎？",
	main = "人們有時說命運無法改變，有時又說自己的命運靠自己掌握……命運，究竟是什麼樣的存在呢……|這份會失控的力量，一定也是命運給予我的考驗吧。但是，我不想就這樣隨波逐流……|指揮官，您有沒有過什麼時候，覺得某件事情就像是命中注定一般會發生？啊，不必在意，只是突然有些好奇……",
	battle = "必須要這麼做嗎……",
	upgrade = "好像能更好地控制住自己了……",
