	mail = "給你的信？本王當然有權利過問，只不過本王同樣尊重你的隱私罷了。",
	touch = "膽敢隨意觸碰本王的身體，你還真是無所畏懼呢。",
	profile = "超無畏艦伊莉莎白女王號，隨時歡迎任何人加入本王的麾下。皇家也好，別的什麼人也好，任何跟隨本王的人，都將得到本王的庇護。好了，我的僕從，趁本王心情好，你還有什麼想問的嗎？",
