	feeling5 = "僕從，本王非常滿意你的表現。唯一不足的就是你有時候對解決問題過於專注了。我的意思是，你應該更多地把目光放在其它地方！例如……放在本王身上，什麼的……",
	main = "不必向著縹緲的天空祈禱，向本王祈禱就好了。本王會祝福你，庇佑你的。|威嚴可不是靠身材大小決定的，本王自會讓所有質疑者心服口服……當然了，我可沒允許誰說本王嬌小！|一切都和諧美好的港區——僕從，這就是你的願景嗎？沒什麼，本王覺得很欣慰。",
