_G.pg.base.ship_skin_words[9706010] = {
	feeling1 = "我怎麼攤上了個這麼軟弱的指揮官……",
	feeling3 = "眼罩？對戰鬥不會造成什麼影響的，放心吧。",
	lose = "啊啊啊真是不爽！下次一定要把你們都砍了！",
	propose = "這就是…指揮官給與的承諾嗎？哈哈，太高興了反而有點不知道該如何反應了…那個…要不我們出去多幹掉幾個敵人慶祝下？",
	expedition = "委託完成了？我看看…嗯哼，後勤物資越來越豐富了。",
	win_mvp = "不錯，是一場很愉快的戰鬥。",
	home = "回來了？好，來商量下次什麼時候出擊吧。",
	mission = "任務來了哦。如果是對付塞壬的就好了。",
	touch2 = "是說這裝甲不夠華麗嗎？",
	voice_key_2 = -1,
	skill = "啊哈哈哈！滅殺！",
	drop_descrip = "{namecode:85}號航空母艦<color=#92fc63>(若已獲得相應的META角色，獎勵將會轉化為對應的角色結晶，可在「META研究室」-「能量啟動」中使用)</color>",
	mail = "接著，你的信。",
	touch = "哦？是有塞壬出沒的情報了嗎？",
	profile = "我是{namecode:85}型航空母艦{namecode:85}。雖說我和妹妹{namecode:86}都是輕航，不過你完全可以把我們當成正規航空母艦來看。放心，不會讓你失望的。",
	mission_complete = "好，任務完成了！",
	feeling4 = "指揮官負責帶領大家前進，我則負責清除擋路的障礙。完美！",
	unlock = "哼哼，把我{namecode:85}招攬至麾下，算是你看對人了。說吧，接下來我們要去哪裡幹掉哪些敵人？",
	feeling5 = "指揮官儘管做自己想做的事，往自己的目標前進吧，我會一直在你身邊，與你一起戰鬥的。",
	main = "{namecode:86}嗎…她現在的狀態很好，大概不需要我擔心吧。|進攻就是最好的防守，只要在被打到之前把對手打倒就好！指揮官也是這麼覺得的吧？|老是悶在這裡處理文書，身手都要變遲鈍了…指揮官，下次出擊是什麼時候？",
	battle = "很好，就這樣衝散敵方陣型！",
	upgrade = "有沒有敵人能立刻讓我練練手的？",
	voice_key = 970601,
	headtouch = "再多摸幾秒，我就不敢保證指揮官會怎麼樣了呢，呵呵呵…",
	feeling2 = "消滅眼前的所有敵人，讓自己活下來。所謂戰場，其實挺簡單明快的不是？",
	login = "指揮官，我已經等不及了。出港的準備我已經都做好了！",
	vote = "",
	hp_warning = "這點小傷算什麼！",
	id = 9706010,
	detail = "就這麼閒著可不行啊…指揮官，就沒有什麼塞壬出沒的情報之類的嗎？",
	couple_encourage = {}
}

_G.pg.base.ship_skin_words[9706020] = {
	feeling1 = "我是成熟的大人，憧憬青梅竹馬之類的……",
