	drop_descrip = "{namecode:86}號航空母艦<color=#92fc63>(若已獲得相應的META角色，獎勵將會轉化為對應的角色結晶，可在「META研究室」-「能量啟動」中使用)</color>",
	mail = "有你的郵件，及時查看吧。",
	touch = "不是很明白你的意思…",
	profile = "不知道你想從我這裡知道什麼…但，如果是問我過往經歷的話，我恐怕要讓你失望了…因為，確實沒有什麼能回答上的。",
	mission_complete = "任務完成了…我們，似乎很有默契…？",
	feeling4 = "如果…我是說如果，我和指揮官的相遇的時間點能更早一些的話…說不定，就有很多東西能變得更好…呢？",
	unlock = "我是…{namecode:86}。指揮官，有指示的話…告訴我就好。",
	feeling5 = "即使我們並非青梅竹馬也沒關係。我們一起經歷了許多，彼此之間的關係早已不亞於那些故事裡的“青梅竹馬”，不是嗎？",
	main = "{namecode:85}啊……她還是那樣的好鬥呢。|必須保持專注……啊，我在冥想，請暫時不要打擾我。|“式神”艦載機嗎…這是我用來對付塞壬的武器。不過我自己的式神，除了我以外的人是絕對不能碰的…嗯，絕對……",
