_G.pg.base.ship_skin_words[9706030] = {
	feeling1 = "指揮官，你是不是狀態不太好？你也許需要休息……",
	feeling3 = "我只記得自己去執行一項特殊的任務，結果和同伴們走散了，被困到了奇怪的地方。終於脫困之後便到了這裡，沒想到已經過了這麼久……",
	lose = "行動失敗了……非常抱歉，指揮官。",
	propose = "這，這是選擇了我的意思嗎？沒想到你會這麼重視我……那我就更不能離開你了。我願意將自己的全部託付給你，一起朝著新的未來前進吧！",
	expedition = "委託組順利返航了。有沒有什麼需要我去幫忙的？",
