	mission_complete = "任務已經完成了。這些獎勵剛好可以擴充後勤物資儲備。",
	feeling4 = "直覺告訴我，指揮官是值得信任的人，你也用行動證明了我是對的。請不用顧慮，盡情驅使我的力量為你所用吧。",
	unlock = "航空母艦普林斯頓，向指揮官報到……對不起，我現在還有些混亂，方便的話能說明一下現狀嗎？",
