	main = "小、小加加？！我怎麼能對薩拉托加前輩用這麼親暱的稱呼！還是「薩拉托加前輩」就好。|如果裝備能進一步升級的話，就可以在戰鬥中承擔更多的責任了。|為指揮官分憂是秘書艦的職責。請問有什麼需要我幫忙的嗎？",
