	feeling4 = "即便面對強敵，即便知道自己毫無勝算，你也會義無反顧地戰鬥嗎？ ——“若是為了守護重要之物的話”…嗎？哼，雖然天真，不過，並不讓人反感。",
	unlock = "我是{namecode:94}，二航戰的{namecode:94}。既然加入，那我便會聽從你的指揮，希望…你是真正有資格指揮艦隊之人吧。",
	feeling5 = "從你的身上，能讓人感受到堅定的“信念”，若是你的話，也許…呵，看來我也還有著天真的一面啊……沒什麼，總之，我認可你了。我會成為你最鋒利的刃，儘管驅使我吧。",
	main = "企業嗎？無論作為對手，或是作為隊友，都是值得尊敬的存在。 |花札？現在不是考慮玩的時候吧。 |平日的鍛煉，不是為了誇耀身手，是為了在戰場上更好的保護夥伴，消滅敵人，不是嗎？",
	battle = "兵貴神速！艦載機，起飛！",
	upgrade = "……謝謝。",
	voice_key = 970701,
	headtouch = "",
	feeling2 = "無須多問，現在我是你的士兵，你是我的指揮者，如此而已。",
	login = "告訴我，今天需要殲滅的敵人在哪裡。",
	vote = "",
	hp_warning = "還…不到絕望之時！",
	id = 9707010,
	detail = "有在我這晃蕩的閒情，不妨多關心關心港區的其他夥伴吧。",
	couple_encourage = {}
}

_G.pg.base.ship_skin_words[9707020] = {
	feeling1 = "如果你還聽得進去的話，我勸你回頭，指揮官閣下。",
	feeling3 = "艦船若是迷失了方向，終究會沉沒於大海，人也一樣。指揮官閣下，在你的心中，有一個正確而堅定的航向嗎？",
	lose = "不是每次的戰鬥，都能有這樣的退路…",
