_G.pg.base.ship_skin_words[9707030] = {
	feeling1 = "別等到危機來臨的時候再後悔，到那時可就來不及了。",
	feeling3 = "花札？有些時日沒聽到這個東西了呢…若是有興趣的話，完成工作之後，陪你來一局也無妨。",
	lose = "留給我們的時間不多了…",
	propose = "這麼慌亂可不是你應有的作風，究竟什麼事——等等…這個是…原來如此…呵呵，何必那麼擔心呢，我的回答，你不是應該早就清楚了嗎？",
	expedition = "委託物資運送回港了，去清點吧。消耗，收穫，損失，這些都別忘了詳細紀錄下來。",
	win_mvp = "高效地贏下勝利，這正是我們需要的。",
	home = "做一下戰鬥總結吧。雖然麻煩，但是有效。",
	mission = "完成任務是你身為指揮官的使命。去吧。",
	touch2 = "（嘆氣）無藥可救了啊…",
	voice_key_2 = -1,
	skill = "沒有時間可以浪費了！",
	drop_descrip = "{namecode:93}號航空母艦<color=#92fc63>(若已獲得相應的META角色，獎勵將會轉化為對應的角色結晶，可在「META研究室」-「能量激活」中使用)</color>",
	mail = "新的信件，放你桌上了。如果是{namecode:94}的話，大概會直接讓你接著吧。",
	touch = "希望你是因為要事才分神來找我說話。",
	profile = "航空母艦，二航戰{namecode:93}。我會一直盯著你，直到你成為足夠優秀的指揮官為止。",
	mission_complete = "任務獎勵的清單——我來吧，你就休息一會好了。",
	feeling4 = "你以為我不清楚，你是想接近我才提起花札的嗎？呵呵~來吧，讓我們再來一局。邊玩花札的時候，我來給你講講你尚且不足的地方吧。",
	unlock = "重櫻二航戰，{namecode:205}。見面的禮節就先省去，讓我們抓緊時間開始正事吧。",
	feeling5 = "現在的你，即使面對最嚴峻、最艱難的狀況，也能沉著冷靜地想出解決的辦法了吧。不過，我還是會在你身邊時刻盯著你的，可不要鬆懈哦？",
	main = "{namecode:94}…又在自主訓練了啊，還是一如既往地自己很嚴格呢。指揮官，也向她學習下，多點自律少點懈怠如何？|過去無法改變，著手當下，才是最明智的。|又在發呆了吧？我得提醒你，你的一舉一動，都是逃不過我眼睛的。",
	battle = "盡快解決戰鬥吧。",
	upgrade = "戰力強化嗎…好，辛苦了。",
	voice_key = 970703,
	headtouch = "",
	feeling2 = "此時的懈怠，很可能會成為將來彼時面對強敵時的破綻。如果你不能狠下心對自己嚴格，那就讓我來承擔這個角色吧。",
	login = "既然你來了，就直接進入主題吧。給，這是等著你處理的公文。",
	vote = "",
	hp_warning = "冷靜下來，尋找突破口——",
	id = 9707030,
	detail = "你覺得自己算一名稱職的指揮官嗎？如果不能第一時間給出“是”的答案，那麼，請反思自己。",
	couple_encourage = {
		{
			{
				9707010
			},
			1,
			"二航戰，出擊！",
			0
		}
	}
}

_G.pg.base.ship_skin_words[9708010] = {
	feeling1 = "也許沒有交集反而是件好事呢。總之，你做你的，我做我的，我們互不相欠，就這樣吧~",
	feeling3 = "如果指揮官哪天突然消失了，是不是等於背棄了港區所有人與指揮官的約定？所以指揮官可不能擅自拋下大家哦。",
	lose = "算了，已經夠了。不應該再有人為離別而落淚了。",
	couple_encourage = "",
	expedition = "委託的同伴們回來了哦。你不是約好了要去接她們嗎？快去吧。",
	win_mvp = "總之，贏了就好~",
	home = "回來了嗎？你不在的時候，我順手幫了港區的同伴們一些小忙——以你的名義哦~",
	mission = "有新任務哦。我無所謂，但放著不管的話，對指揮官來說會越來越麻煩吧？",
	touch2 = "難道指揮官你……其實是慣犯了？呵呵~",
	propose = "「誓約」你知道這對我們意味著什麼……這真的是最後一次的承諾了。請一定不要擅自打破約定，請不要讓那殘酷的事情再發生了……我的指揮官，可以答應我嗎？",
	skill = "可別怪我哦？",
	drop_descrip = "{namecode:416}號潛艇<color=#92fc63>(若已獲得相應的META角色，獎勵將會轉化為對應的角色結晶，可在「META研究室」-「能量激活」中使用)</color>",
	mail = "有你的郵件喔~順手幫你拿過來了。",
	touch = "現在可沒時間玩鬧呢。",
	voice_key_2 = -1,
	profile = "那個誓言嗎……我當然一直記著的。只是經常掛在嘴邊的話，俾斯麥大姊也會尷尬的吧。而且大姐也希望我能夠更獨立一些，綜·上·所·訴·我就把它放在心裡了~",
	mission_complete = "任務完成了。任務報酬我幫你拿一下吧——只是順手而已。",
	feeling4 = "「曾經與某人重要的約定」……指揮官，你覺得那是幼稚的衝動，還是天真的幻想？我知道你肯定會說「兩個都不是」，因為你就是這樣溫柔的人啊。",
	feeling5 = "如果可以的話，我也想一直當一個無憂無慮的「海之騎士」，偶爾漫無目的地潛水玩耍。不過，我也不討厭現在的自己。至少我還遇見了你，能讓我傾訴所有心聲的重要之人……不是嗎？",
	main = "到底怎樣才算是「成熟」？不再天天想著玩算嗎？好像沒有那麼簡單吧。|做些什麼事情讓心情好起來呢……對了！不然去港區看看，有沒有需要幫助的孩子吧~|叮咚~雖然不知道指揮官有沒有和別的孩子約好什麼事，不過還是提醒一下不要爽約哦。",
	unlock = "「海之騎士帕西瓦爾」，潛艇U-556來了哦。我不知道這裡有沒有我能幫上忙的地方呢……反正我要在這裡打擾一段時間了，多多指教囉~",
	upgrade = "變得更強了，就能做到更多的事嗎……",
	voice_key = 970801,
	headtouch = "嗯？嗯？你在做什麼？",
	feeling2 = "「海之騎士帕西瓦爾」出動！今天有什麼地方需要我幫忙的呢~指揮官，你不會介意我用你的名義去幫別的同伴吧？",
	battle = "對不起啦，畢竟是敵人呢~",
	login = "歡迎回來。是和誰約好了在這個時候見面嗎？如果是的話，我就先不打擾你了~",
	hp_warning = "別來妨礙我！",
	id = 9708010,
	vote = "",
	detail = "與別人的約定啊……指揮官也和許多同伴有過約定吧。後來呢，那些約定都實現了嗎？總有那麼幾個因為這樣那樣的原因，最後不得不放棄了對吧。"
}

_G.pg.base.ship_skin_words[9712010] = {
	feeling1 = "指揮官，你病了，病得很深。只要你願意配合治療，一切都還能挽回。",
	feeling3 = "指揮官，要不要抽點時間檢查下自己的身體？船需要維護，人也一樣。可不能說什麼“看不見的問題就不存在”。",
	lose = "受傷的人再多下去的話，會變得很麻煩的……",
	couple_encourage = "",
	expedition = "委託物資送到了。是補充的醫療用品。",
	win_mvp = "有人受傷了嗎？沒有就好。",
	home = "剛剛的戰鬥有人受傷了嗎？ ……最好檢查一下？",
	mission = "雖然任務還有很多，但請務必控制自己身體的負荷。",
	touch2 = "對溫柔的貪戀也是一種病哦，指揮官。",
	propose = "我答應您，但您也必須答應我——從今往後，一定要愛惜自己的身體，時刻以健康為重。艦隊的大家需要您，我也需要您……請不要忘了。",
	skill = "不聽醫生的話可不行哦。",
	drop_descrip = "女灶神號維修艦 <color=#92fc63>(若已獲得相應的META角色，獎勵將會轉化為對應的角色結晶，可在「META研究室」-「能量啟動」中使用)</color>",
	mail = "遠方寄來的信……盡快看一下比較好，指揮官。",
	touch = "需要幫您檢查下身體狀況嗎？",
	voice_key_2 = -1,
	profile = "我是維修艦女灶神號，你可以把我當做是艦船的醫生。當然，如果您覺得有不舒服的地方，我也能幫您看看。",
	mission_complete = "任務完成了。指揮官，給自己留一點喘息時間吧？",
	feeling4 = "心事淤積，終會有爆發失控的一天。指揮官，如果有孩子與你訴苦，請一定要耐心傾聽。當然，如果需要的話，我也會傾聽您的煩惱的。",
	feeling5 = "您希望我能一直照顧您……真是個奇怪的要求，沒有人會希望天天面對醫生的。當然，我也樂意照顧您就是……誰讓您是我在意的指揮官呢。",
	main = "最讓醫生頭疼的，當屬逞強又隱瞞自己病情的孩子了吧。拖得久了，真的會出事的哦？|嗯？ ……比起關心我的狀態，您應該還有更重要的事情要做。|救死扶傷乃醫者天職。即使是因此而受傷，我也不後悔……當然，我沒有不愛惜自己的想法。我會做好必要的保護措施。",
	unlock = "指揮官……是嗎？您看起來很健康，並沒有生病。我是女灶神，如果有人生病或者受傷的話，我可以幫忙治療以及修理……",
	upgrade = "希望能幫上更多的人吧。",
	voice_key = 971201,
	headtouch = "",
	feeling2 = "雖然指揮官的專業不是治病，但您也經常和艦隊的孩子們交心，為她們排憂解難。從這點上看，您也算是她們的醫生。",
	battle = "請務必以安全為重。",
	login = "您回來了。指揮室已經消過毒了，希望您不會介意這淡淡的氣味。",
	hp_warning = "沒關係，緊急處理一下就好。",
	id = 9712010,
	vote = "",
	detail = "凋謝的薔薇不會再綻放，逝去的生命亦不會再歸來……生命之重，絕非能輕易地用天平稱量。"
}

_G.pg.base.ship_skin_words[9713010] = {
	feeling1 = "唔，你忙昏頭了嗎……",
	feeling3 = "工作是做不完的，指揮官，切莫因此忽略了當下生活。畢竟，與同伴相處的時光總是珍貴且不復返的……",
	lose = "黑暗還會回來的……",
	propose = "在這裡做出約定嗎……嗯，我明白你的心意了，指揮官。那麼，黑暗會見證我們的誓言，只要在有光的地方，黑暗之影就會永遠與您相伴……",
	expedition = "同伴們全都安然無恙地回來了，可以安心了。",
	win_mvp = "按照契約，爾等的靈魂，由我收下了。",
	home = "歡迎回到寧靜的世界，指揮官。請盡情享受這一刻的美好時光。",
	mission = "有新的任務……別擔心，這不是死後世界的委託。",
	touch2 = "……讓你靈魂出竅的獨特服務，要體驗一下嗎？",
	voice_key_2 = -1,
	skill = "願你安寧……！",
	drop_descrip = "黑暗界號淺水重炮艦<color=#92fc63>(若已獲得對應的META角色，獎勵將會轉化為對應的角色結晶，可在「META研究室」-「能量啟動」中使用)</color>",
	mail = "信件……承載著美好的回憶與殷切的希望，要珍惜呢。",
	touch = "不要緊張，我會一直在這裡……",
	profile = "「之前」的戰鬥中，我受了很嚴重的傷，因為伊莉莎白女士始終沒有放棄，我才能用這樣的姿態繼續戰鬥下去……所以，我也想和伊莉莎白女士一樣，為夥伴們做些力所能及的事，嗯。",
	mission_complete = "獎勵，記得領取……畢竟，多一點也沒壞處。",
	feeling4 = "這杯咖啡，我沒收了。……接下來會有提神醒腦的需求？讓我想想……嗯~鬼屋會是個好去處，指揮官。",
