_G.pg.base.ship_skin_words[10900030] = {
	ryza_item5 = "不利用好敵人的力量是無法保護好同伴的。先收集起來吧",
	feeling3 = "這個石頭，可以用於鍊金術嗎……啊，抱歉。和萊莎她們冒險時會邊走邊收集材料，不知不覺就……",
	mission = "好像還有剩餘的工作呢……要我幫忙嗎？",
	feeling4 = "坦白說出自己的心情是很重要的。指揮官也一樣，要是有什麼的話請不要勉強自己，說出來就好。只是傾聽的話我還是做得到的。",
