	unlock = "您就是指揮官嗎？我是派翠夏‧阿貝爾海姆。叫我帕蒂就行了。看來暫時要受您照顧了，請多關照。",
	touch2 = "……想吃我一擊嗎？",
	feeling1 = "要是沒什麼事的話，我就告辭了。",
	vote = "",
	drop_descrip = "您就是指揮官嗎？我是派翠夏‧阿貝爾海姆。叫我帕蒂就行了。看來暫時要受您照顧了，請多關照。",
	mail = "咦，好像有什麼送到了……啊，是給指揮官的信嗎。",
	lose = "怎麼會這樣……大家，趕緊撤退！",
	propose = "我能融入這裡這個世界，是因為指揮官一直以來的默默守護。因此，就算為表感謝也好，我希望能幫上指揮官更多的忙……之後也請多多指教了。",
	ryza_shop1 = "",
	touch = "有、有蟲子！……指揮官，謝謝你。我不怎麼應付得來蟲子，趕走它真是幫大忙了……",
	ryza_item2 = "寶石？不如拿來作為港區資金的一部分……看來不行呢",
	feeling5 = "說實話剛來這裡的時候，總有種“這世界怎麼回事？！”的感覺，而現在已經在不知不覺間融入了這裡的生活。這也多虧了指揮官的支持呢。",
