	feeling5 = "原來如此，你並不在乎旅行的終點，而更加在意同行的夥伴嗎。也就是說，只要和我一起，無論去哪都沒問題！是這樣吧，哈哈哈…唔？等等，這意思不就是…",
	main = "武裝艦船的是裝甲、火炮和魚雷，而武裝人的，則是膽識、見識與學識。 |我不討厭禮節，也不反對適當的儀式感，不過，繁文縟節的東西，能少點還是盡量少點好。 |比起榨好的蘋果汁，還是沾著露水的新鮮蘋果更誘人，你也是這麼覺得的吧！",
