	skill = "",
	drop_descrip = "頌揚之歌獻予尊崇鳶尾，鳴奏之樂凝為清澈祈禱。賜福所求並非禮拜之儀，永存羈絆方乃人之偉業——",
	mail = "信件往來——歡喜、空虛、自豪、不甘——皆由指揮官回复所致。",
	touch = "指揮官之體溫，心跳，五感所觸，皆誘香檳喜不自勝。",
	profile = "",
	mission_complete = "",
	feeling4 = "",
	unlock = "頌揚之歌獻予尊崇鳶尾，鳴奏之樂凝為清澈祈禱。賜福所求並非禮拜之儀，永存羈絆方乃人之偉業——",
