	battle = "此身皆為指揮官而戰——便是香檳所定之信條。",
	upgrade = "",
	voice_key = 0,
	headtouch = "",
	feeling2 = "",
	login = "感慨，知覺。相繫之心的鼓動怦然，觸碰雙唇的潤然柔香。",
	vote = "",
	hp_warning = "",
	id = 899028,
	detail = "誓約無謂稱頌。戀慕、忠誠、肩負使命、信仰教條——現在的香檳乃守護身為人之幸福的存在。",
	couple_encourage = {}
}

