	main = "啊，請小心。愛丁堡小姐，如傳聞一樣有點冒失呢。|是要銷毀資料嗎。（爆炸聲）……好了，用剛才的攻擊讓資料都化成灰了，希望您能高興。|工作不順利嗎？那我講個童話故事給您聽吧。很久很久以前……",
