	profile = "我是白鷹所屬的，具現化的特別計畫艦奇爾沙治。我被設計為戰艦和航空母艦的混合型，內藏能應付任何戰局、戰場的力量。指揮官，希望你能充分利用我的戰力",
	mission_complete = "確認任務獎勵已送達。我去回收。",
	feeling4 = "用「約會」這種說法可能不大準確，但要了解指揮官的習慣和行為，確實透過「約會」更有效。這是今天的行程。過目一下再行動吧。",
	unlock = "……啟動完畢。我是混合假想的實體化·「X」，航空戰列艦奇爾沙治。從今天開始，我將在這港區成為你的力量。那麼，我該歸屬於哪個分隊，該往何處出擊？",
	feeling5 = "我信任著指揮官，而且想更多的了解指揮官。但是，因為我的能力不足，現在還缺乏一些用來理解指揮官意願的必要情報……指揮官信任我嗎？用同伴們的話來說，你\"喜歡\"我嗎？",
	main = "閒聊的話就放到工作結束後吧。我現在正在專心處理秘書艦的工作，請不要打擾我。|與其一直回頭看，還是不停下腳步繼續向前更好。即使要自我反省，不配合當時的情勢來看也是沒有意義的。|在戰鬥中，有時必須優先考慮戰局，而非你的意志。即使你是指揮官，也可能不得不將決定權下放至戰場，最好趁現在先習慣吧。|…………（奇爾沙治閉著眼，端正地坐在沙發上。或許她睡著了？）",
	battle = "戰力充足——向前突破！",
	upgrade = "確認性能及艦隊戰力提升。今後請繼續關照。",
	voice_key = 19904,
	headtouch = "……嗯？突然這是怎麼了？",
	feeling2 = "我認為與指揮官建立信任關係對我的戰鬥行動更有利。這就讓我看一下你的行程——嗯？要了解對方首先需要收集訊息，這不是常規手段嗎？",
	login = "指揮官？抱歉，我先著手工作了……不用在意我，照計畫進行你的工作吧",
	vote = "",
