	id = 199040,
	detail = "…………我並沒有睡著，只是讓大腦稍微休息一下而已。雖然讓門就這樣敞開著是我疏忽了，但不敲門就進來的指揮官也有責任呢。",
	couple_encourage = {}
}

_G.pg.base.ship_skin_words[399060] = {
	feeling1 = "惹怒龍會怎樣——指揮官不會為了滿足好奇心而特地付諸行動的……對吧？",
	feeling3 = "感覺你還是有些拘謹。如果你不改變，那我也會配合你，以更具威嚴的方式接觸你——（咕嚕咕嚕……）這，這不是肚子叫的聲音……是，是雷聲啦。",
