	main = "你問我想要什麼貢品？既然你都這樣說了，那就指揮官喜歡的零食……沒什麼。咳，什麼零食都可以的。|工作還沒結束吧？只剩下一點了，堅持下去吧？……。如果偷懶的話，我可是會降災的哦？|我多少能理解御狐大人的煩惱。雖然多虧了指揮官我現在挺輕鬆的，但是被眾人所尊崇真的很累……而且一直被叫做龍神大人，也是很難為情的。|嗯，疊好了。啊，這個不是普通的紙飛機而是式紙……不過現在確實就跟指揮官說的一樣，只是普通的紙飛機呢……唔……",
