_G.pg.base.ship_skin_words[499080] = {
	feeling1 = "什麼啊，只是個沒意思的灰塵而已。算了算了，本小姐對你沒興趣了，灰塵就要像灰塵一樣落到一邊待著去啊",
	feeling3 = "哦？居然對本小姐的誘惑不為所動，是在硬撐呢還是單純的無能呢？（為什麼效果不好？是我做得還不夠嗎？還是哪個環節出了問題？）",
	lose = "這，這次的失敗是有深層而不可預知的因素在裡面……你明白就好。",
	propose = "真是美妙啊，這種被認同的感覺，比看著不知道哪來的雜魚求饒還要美妙上一千倍……為什麼本小姐沒能早點注意到呢？你說是吧……指揮官，和{namecode:519}一同墜入那夢幻迷人的深淵吧～",
	expedition = "委託物資已經清點完了。本小姐姑且也是出了點力的，你要怎麼補償我呢？",
	win_mvp = "區區螻蟻也想贏本小姐？呵呵呵～",
	home = "出擊辛苦了哦，本小姐就勉為其難地好好戳一戳你那鈍感的身體吧。（哼哼，你一定承受不住這招的～）",
	mission = "任務有點多？行吧，本小姐就大發慈悲幫幫你這可憐又愚蠢的傢伙好了。不過，這人情後面可是要還的哦？",
	touch2 = "終於要承認自己的腦袋和猴子一樣了？嘻嘻～",
	voice_key_2 = -1,
	skill = "不堪一擊！",
	drop_descrip = "驅逐艦—菲利克斯·舒爾茨",
	mail = "連信都要本小姐幫你拿嗎？算了，趁本小姐心情好，無償幫你一回。",
	touch = "對本小姐有好奇嗎？這樣啊，那就把你那有眼無珠的眼睛睜大點看哦～（你能經得住我的誘惑嗎？呼呼～）",
	profile = "{namecode:518}，鐵血的特別計畫艦之一。想讓本小姐成為你的助力嗎？很簡單，讓本小姐覺得開心就好了。我沒有說讓你無條件服從之類的話，已經很大度了哦？",
	mission_complete = "嗯~哼——任務完成了。總算不是一個完全無能的傢伙了呢，本小姐對你的好感度上升了哦。",
