	unlock = "哦？你好呀，指揮官。大費周章地把我喚來此處，卻又用這種小伎倆把我束縛住，真是難為你了呢。等著吧，本小姐馬上就會讓你這愚鈍之人跪倒的哦",
	feeling5 = "啊……是本小姐輸了。沒能征服指揮官，反倒差點就要承認你了。不過這樣一來，本小姐就能更加不擇手段地進攻了～要嘛屈服，要嘛徹底接受我。在這之前我是絕對不會停止的！",
	main = "明天是晴天嗎？真可惜，少了個能讓指揮官在這裡守著本小姐的理由呢。|嗯？你說什麼？本小姐沒聽清楚。能不能湊近一點呀？|（在認真工作啊……想想有沒有能讓指揮官更聽我話的辦法……）嗯？怎麼了？什麼事都沒有哦～",
	battle = "那就給這些無禮者們一點教訓好了。",
	upgrade = "嗯哼～本小姐現在心情不錯～",
	voice_key = 49908,
	headtouch = "本小姐高貴的額頭豈是你這種人可以隨便觸碰的？不過，這次就原諒你的無知好了～",
	feeling2 = "人不過也就是一種野獸罷了。本小姐要將你心中的野獸驅使出來，然後站在高處，看著你跪倒在地搖尾乞憐。哼哼～",
	login = "這麼快就想我了？總不能只是因為雜事回來得這麼早吧？",
	vote = "",
	hp_warning = "你，你別光看著，快用你那廢物腦子想想看啊？",
	id = 499080,
	detail = "本小姐喜歡吃蘋果。特別是那種切得碎碎的，一口一塊的那種。就像這樣哦——啊～嗚～你也想要嗎？",
	couple_encourage = {}
}

_G.pg.base.ship_skin_words[499090] = {
	feeling1 = "罷了，我就當這契約沒存在過吧。我會記得你現在所做的一切，並在某一日悉數奉還。",
	feeling3 = "特地叫我出來不是為了公務。那也就是說這個行為完全處於你作為個體的慾望吧。……很好，我也就不必拘泥於「指揮官的艦船」，而可以向你展示一下{namecode:521}這一個個體的本性了呢",
	lose = "哼，不錯的對手。希望下次再交手時，也不會讓我失望。",
	propose = "不滿足於現有的契約，妄圖用更進一步的手段將我束縛？契約者，你的膽子真是越來越大了。好啊，我就如你所願，答應你的請求。以及，接下來就做好隨時被我吃掉的準備吧，呵呵呵～",
	expedition = "委託的物資送到了？交給其他人去做吧。你沒有時間做到任何事都親力親為。",
	win_mvp = "對圖謀不軌者而言，痛苦是最好的課程。",
	home = "契約者，還在想著剛剛的戰鬥？是有讓你在意的對手，還是對我的表現有所不滿？",
	mission = "去完成你該完成的事吧，契約者。我當然指的是那些任務。",
	touch2 = "該讓你長點記性了啊，契約者。",
	voice_key_2 = -1,
	skill = "向我俯首，蟲子們！",
	drop_descrip = "重巡洋艦—興登堡",
	mail = "契約者，早點查看信箱。這種事情不該由人提醒你。",
	touch = "趁我還對你要說什麼感興趣前，把話講清楚。",
	profile = "鐵血巡洋艦，{namecode:521}。似乎像我這樣的艦船被稱為「特別計劃艦」？無所謂。向我證明你的能力，填充我無聊的時光，我自會遵守與你的契約。",
	mission_complete = "任務完成了。對著如此小事就盼望著對方有所回報，我記得並沒有和這樣的傢伙簽訂契約吧？",
	feeling4 = "當你試圖控制惡魔的時候，是否已經被惡魔所控制了呢？自己去尋找問題的答案吧，契約者，我在終點等著你。呵，我可不是什麼蠱惑人心的存在，這是你自己選擇的路。",
	unlock = "將我召喚至此的，就是你？凡人，你就是我的指揮官呢？……好吧，我就姑且承認，這份「指揮官和艦船」的契約好了。",
	feeling5 = "我很高興你走到這一步，誓約者。過程無關緊要，重要的只有結果——那就是你已經被我支配的這個事實。怎麼了，心懷不甘嗎？屈服於我，又有什麼不好的呢？",
	main = "契約者，你與其它艦船又是靠什麼維繫的？信任？交易？……原來如此，有點意思。|無聊的時光總是充斥著生活。契約者，如果你不能想辦法緩解我的乏悶，我就只能從你身上尋樂了。|你說想喝點什麼？哼，我並不討厭別人投我所好。來點咖啡吧，不要太苦的。",
	battle = "勇氣是你們的起點，也是你們的末路。",
	upgrade = "也別忘了提升你自己，契約者。",
	voice_key = 49909,
	headtouch = "角？要看隨你喜歡。不過，敢摸的話，你是知道後果的。",
	feeling2 = "有事找我？我以為你會因為畏懼我，對我避而不見。那就剛好藉這個機會，讓我了解你吧，契約者。",
	login = "契約者啊，為日常奔波，就是你選擇的命運嗎？",
	vote = "",
	hp_warning = "能讓我興奮起來……哼，有兩下子。",
	id = 499090,
	detail = "尾巴？翅膀？這些就如此值得關注嗎。有時候真是搞不懂你，契約者。",
	couple_encourage = {
